import React from 'react';
import FeatureImg from "../images/feature1.png";

const Card = () => {
    return (
        <>
        <div className="feature_box">
            <div className="inner">
                <img src={FeatureImg} alt="" />
            <h2>Lowest Price</h2>
            <p>We offer our world class laundry service for as low as $1.33/lb and we're not planning on changing that any time soon.</p>
            </div>
        </div>
        </>
    )
}

export default Card
